import React, { useState, useEffect } from 'react';
import "./Bots.css";

function Bots() {
    
    const bots = [
        {image: 1, name: 'Ford'},
        {id: 2, name: 'BMW'},
        {id: 3, name: 'Audi'},
        {id: 4, name: 'Audi'},
        {id: 5, name: 'Audi'},
        {id: 6, name: 'Audi'},
      ];
   
    return (
        <div>
            <div className="bot-container">
                <div className="msg-container"> 
                    <input 
                    type = "text" 
                    className='bots'
                    placeholder="Available Bots"
                    />
                </div>

                <ul>
                    {bots.map((bot) => <li> {bot.name}</li>)}
                </ul>
            </div>
        </div>
    )
}

export default Bots
